    return (
        <>
            {
                isAdmin && <AdminSecretHeader />
            }
        </>
    )
}

export async function getServerSideProps (ctx) {
    return {
        props: {
            participants: [],
            hasDrew: false,
            isAdmin: true
        }
    }
}

